import React from "react";

function Nav(props) {
    const {setHomeState} = props;

    return (
        <>
        <ul >
            <li><a href="#project" onClick={()=> setHomeState(false)}>PROJECTS</a></li>
            <li><a href="#about" onClick={()=> setHomeState(false)}>ABOUT</a></li>
            <li><a href="Resume/LisaLeResume.pdf" target="_blank">RESUME</a></li>
        </ul>

        <div id="navigation" class="logo">
            <a className="slice" href="/" onClick={()=> setHomeState(true)}>
                <div className="top"><span>Lisa Le</span></div>
                <div className="bottom"><span>Lisa Le</span></div>
            </a>
        </div>
        </>
    )
}

export default Nav;
